const testFileTree = {
  name: "root",
  isFolder: true,
  assets: {
    name: "assets",
    isFolder: true,
    fonts: { name: "fonts", isFolder: true, "helvetica.otf": { name: "helvetica.otf" } },
    images: {
      name: "images",
      isFolder: true,
      "logo.png": { name: "logo.png" },
      "avatar.jpg": { name: "avatar.jpg" },
    },
  },
  "index.js": { name: "index.js" },
};

export default testFileTree;
